import classes from './Layout.module.css';
import NavigationBar from './NavigationBar';

function Layout(props){
    return <div>
        <NavigationBar className={classes.fixposition} />
        <main className={classes.main}>
            {props.children}
        </main>
    </div>
}

export default Layout;
